import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import "./App.css";

import Footer, { NavbarComponent } from "./components";

const App = () => {
  return (
    <Router>
      <NavbarComponent />
      <Footer />
    </Router>
  );
};

export default App;
